import React from 'react';
import ReactDOM from 'react-dom';
import { Route, Link, Switch, BrowserRouter as Router } from 'react-router-dom';
import './index.css';
import Home from './components/Home';
import Favorites from './components/Favorites';
import Navbar from './Navbar';
import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            favoriteList: [],
            json: null, 
            jsonIndex: 0,
            searchTerm: null,
            page: 1,
            beerList: []
        }
    }

    getAndDisplayBeers = (searchTerm) => {
        fetch(`https://api.punkapi.com/v2/beers?page=${this.state.page}&per_page=80&beer_name=${searchTerm}`)
        .then((response) => {
          return response.json();
        })
        .then((json) => {
          if (this.state.json !== null) {
            if (JSON.stringify(this.state.json) === JSON.stringify(json)) {
              return;
            }
          }
          if (searchTerm === this.state.searchTerm) {
            this.setState({json: json,
                           jsonIndex: 0}, () => {
                              this.displayBeers();
                            });
          }
          else {
            this.setState({json: json,
                           jsonIndex: 0,
                           searchTerm: searchTerm,
                           page: 1,
                           beerList: null}, () => {
                              this.displayBeers();
                          });
          }
        })
        .catch((error) => {
          console.error(error);
        })
    }

    displayBeers = () => {
        let numBeers = this.state.json.length - this.state.jsonIndex;
        if (numBeers >= 6) {
            this.makeBeerListThenDisplay(6);
        }
        else if (numBeers !== 0) {
            this.makeBeerListThenDisplay(numBeers);
        }
        else if (this.state.json.length === 80) {
            this.setState({page: this.props.app.state.page + 1}, () => {
            this.getAndDisplayBeers(this.state.searchTerm);
            });
        }
        else {
            this.setState({page: this.props.app.state.page + 1}, () => {
            return;
            });
        }
    }

    makeBeerListThenDisplay = (numBeers) => {
        let beerList = [];
        if (this.state.beerList != null) { 
          for (let i = 0; i < this.state.beerList.length; i++) {
              beerList.push(this.state.beerList[i]);
          }
        }
        let jsonIndex = this.state.jsonIndex;
        for (let i = 0; i < numBeers; i++) {
            beerList.push({id: this.state.json[jsonIndex].id,
                           img: this.state.json[jsonIndex].image_url,
                           name: this.state.json[jsonIndex].name,
                           description: this.state.json[jsonIndex].description});
            jsonIndex++;               
        }
        this.setState({beerList: beerList, jsonIndex: jsonIndex}, () => {
          ReactDOM.render(this.state.beerList.map(beer => <Beer key={beer.id} beerKey={beer.id} addToFavorites={this.addToFavorites} attributes={beer}></Beer>), document.getElementById('beers'));
          if (this.state.jsonIndex !== this.state.json.length) {
            this.displayButton();
          }
          else {
            this.removeButton();
          }
        });
      }

      displayButton = () => {
        ReactDOM.render(<button className="btn btn-primary w-50" onClick={this.displayBeers}>Load More</button>, document.getElementById('load-more-container'));
      }

      removeButton = () => {
        ReactDOM.render(null, document.getElementById('load-more-container'));
      }


    addToFavorites = (beer) => {
        let beerFound = this.props.favoriteList.find((beer1) => {
            return beer1.id === beer.id;
        });
        if (!beerFound) {
            let newFavoriteList = this.state.favoriteList;
            newFavoriteList.push(beer);
            this.setState({
                favoriteList: newFavoriteList
            });
        }
    }

    render() {
        return (
            <Router>
                <Switch>
                    <Route 
                        exact path="/" 
                        render={() => 
                            <div>
                                <Navbar getAndDisplayBeers={this.getAndDisplayBeers} favoriteNum={this.props.favoriteList.length}></Navbar>
                                <Results favoriteList={this.state.favoriteList} addToFavorites={this.addToFavorites}></Results>
                            </div>}>
                    </Route>
                    <Route 
                        path="/favorites" 
                        render={() =>
                            <div>
                                <Navbar getAndDisplayBeers={this.getAndDisplayBeers} favoriteNum={this.props.favoriteList.length}></Navbar>
                                <Favorites favoriteList={this.state.favoriteList}></Favorites>
                            </div>}>
                    ></Route>
                </Switch>
            </Router>
        );
    }
}

ReactDOM.render(<App></App>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
